		/***************************************************/
		//chargingTimer checks the value of charge and stops charging when its over 90
		//charging
		function charging(){
			//console.log("c"+charge);
			root.batt_discharge.stop();
			root.batt_charge.gotoAndPlay(charge);
			root.batt_charge.visible = true;
			root.batt_discharge.visible = false;
			root.dot_path4.visible = false;
			root.dot_path5.visible = false;
			root.dot_path4_rev.visible = true;
			root.dot_path5_rev.visible = true;
			var chargingTimer = setInterval(batt_up, 100);
			function batt_up(){
				charge = charge + 0.01;
				if (charge > 90||charge > chargingKill){
					root.batt_charge.stop();
					clearInterval(chargingTimer);
				}
				return charge;
			}
		}
		
		//discharging
		function discharging(){
			discharge = 100 - charge;
			//console.log("d"+discharge);
			root.batt_charge.stop();
			root.batt_discharge.gotoAndPlay(discharge);
			root.batt_charge.visible = false;
			root.batt_discharge.visible = true;
			root.dot_path4.visible = true;
			root.dot_path5.visible = true;
			root.dot_path4_rev.visible = false;
			root.dot_path5_rev.visible = false;
			let frRate = 12 * outputSum;
			root.batt_discharge.framerate = 9;// changes discharge rate by utility connected
			let dischargingTimer = setInterval(batt_down, 100);
			function batt_down(){
				charge = charge - (0.05*outputSum);
				if (charge<10||lineVal==1||charge < dischargingKill){
					root.batt_discharge.stop();
					clearInterval(dischargingTimer);
				}
				//check if there is any change in charge
				return charge;
			}
		}
		
